</style><style type="text/css">.App {
  text-align: center;
}

.App-logo {
  -webkit-animation: App-logo-spin infinite 20s linear;
          animation: App-logo-spin infinite 20s linear;
  height: 40vmin;
}

.App-header {
  background-color: #282c34;
  min-height: 100vh;
  flex-direction: column;
  align-items: center;
  justify-content: center;
  font-size: calc(10px + 2vmin);
  color: white;
}

.App-link {
  color: #61dafb;
}

@-webkit-keyframes App-logo-spin {
  from {
    -webkit-transform: rotate(0deg);
            transform: rotate(0deg);
  }
  to {
    -webkit-transform: rotate(360deg);
            transform: rotate(360deg);
  }
}

@keyframes App-logo-spin {
  from {
    -webkit-transform: rotate(0deg);
            transform: rotate(0deg);
  }
  to {
    -webkit-transform: rotate(360deg);
            transform: rotate(360deg);
  }
}
</style><style type="text/css">ol, ul {
  padding-left: 30px;
}



.status {
  margin-bottom: 10px;
}

.square {
  border: 1px solid #999;
  font-weight: bold;
  margin-right: -1px;
  margin-top: -1px;
  padding: 0;
  text-align: center;
  height: calc(12.5% - 1px);
}

.board-row {
  flex: 8 1;
}

.square:focus {
  outline: none;
}

.kbd-navigation .square:focus {
  background: #ddd;
}

.game {
  display: flex;
}

.chess-board {
  height: 100%;
  width: 100%;
  right: 0;
  top: 0;
  display: flex;
}

.game-info {
  margin-left: 20px;
}

.stretchy {
  display:block; 
  float:left; 
  position:relative; 
  overflow:hidden;
  max-width:160px;
}
.stretchy .spacer {
  width: 100%; 
  height: auto;
}
.stretchy .no-limit {
  max-width: none;
}
.stretchy .sprite {position:absolute; top:0; left:0; max-width:none; height: 220%;}
.stretchy .sprite .s2 {left:-100%;}</style></head>
